var adminApp = angular.module('adminApp', ['ngRoute','oc.lazyLoad','requestModule','flash','ngAnimate','ui.select']);

adminApp.controller('FoodUploadController', ['$scope', 'FileUploader', function($scope, FileUploader) {
    //Start code for uploader//
    var uploader = $scope.uploader = new FileUploader({
        url: 'upload.php'
    });

    // FILTERS
    uploader.filters.push({
        name: 'customFilter',
        fn: function(item /*{File|FileLikeObject}*/, options) {
            return this.queue.length < 10;
        }
    });

    // CALLBACKS
    uploader.onWhenAddingFileFailed = function(item /*{File|FileLikeObject}*/, filter, options) {
        console.info('onWhenAddingFileFailed', item, filter, options);
    };
    uploader.onAfterAddingFile = function(fileItem) {
        console.info('onAfterAddingFile', fileItem);
    };
    uploader.onAfterAddingAll = function(addedFileItems) {
        console.info('onAfterAddingAll', addedFileItems);
    };
    uploader.onBeforeUploadItem = function(item) {
        console.info('onBeforeUploadItem', item);
    };
    uploader.onProgressItem = function(fileItem, progress) {
        console.info('onProgressItem', fileItem, progress);
    };
    uploader.onProgressAll = function(progress) {
        console.info('onProgressAll', progress);
    };
    uploader.onSuccessItem = function(fileItem, response, status, headers) {
        console.info('onSuccessItem', fileItem, response, status, headers);
    };
    uploader.onErrorItem = function(fileItem, response, status, headers) {
        console.info('onErrorItem', fileItem, response, status, headers);
    };
    uploader.onCancelItem = function(fileItem, response, status, headers) {
        console.info('onCancelItem', fileItem, response, status, headers);
    };
    uploader.onCompleteItem = function(fileItem, response, status, headers) {
        console.info('onCompleteItem', fileItem, response, status, headers);
    };
    uploader.onCompleteAll = function() {
        console.info('onCompleteAll');
    };

    console.info('uploader', uploader);
    //Start code for uploader//

}]);


adminApp.controller('FoodController',function ($scope,requestHandler,Flash) {


    //sidebar menu active class
    $scope.activeClass = {foodlist:'active'};

    //Get Food List
    $scope.doGetAllFoodItems=function(){
        $scope.loaded=true;
        requestHandler.getRequest("admin/getFoodList/","").then(function(response){
            $scope.foodList=response.data.Food_Data;
            $scope.paginationLoad=true;
            $scope.loaded=false;
        },function(response){
        });
    };
    //End Get Food List

    //Enable Disable Food Items
    $scope.doEnableDisable=function(foodId){
            requestHandler.postRequest("admin/enableordisableFood/",{"foodid":foodId}).then(function(response){
                if(response.data.Response_status==1){
                    successMessage(Flash,"Successfully Updated");
                }
                else if(response.data.Response_status==0){
                    errorMessage(Flash,"Food used by users");
                }
                $scope.doGetAllFoodItems();
            },function(response){
                errorMessage(Flash,"Please Try Again Later");
            });
    };
    //End Enable Disable

    //Get Category
    /*$scope.doGetAllEnabledFoodCategory=function(){
      requestHandler.getRequest("admin/getFoodCategoryByStatus","").then(function(response){
          $scope.foodCategoryList=response.data.Food_Category;
      },function(response){
          alert("Not able to pull Food Category List");
      });
    };
    //End Get Category


    //Get Measures
    $scope.doGetTags= function () {
        requestHandler.getRequest("admin/viewAllfoodMeasure","").then(function(response){
            $scope.foodMeasureList=response.data.viewAllfoodMeasure;
        },function(response){
            alert("Not able to pull Food Measure List");
        })
    };*/
    //End Get Food Measures

    //Initial Load
    $scope.init = function(){
        $scope.paginationLoad=false;
        $scope.doGetAllFoodItems();
    };
    //End Initial Load


});


adminApp.controller("FoodDetailsViewController",function($scope,requestHandler,$routeParams){

    //Get Particular Food Details
    $scope.doGetFoodDetails= function () {
        requestHandler.postRequest("/getFoodDetailByadmin/",{"foodid":$routeParams.id}).then(function(response){
            $scope.foodDetails=response.data.Food_Data;
            $scope.foodDetails.foodImagePath=$scope.foodDetails.foodImagePath.substring($scope.foodDetails.foodImagePath.indexOf("/") + 14, $scope.foodDetails.foodImagePath.length)+"200x200.jpg";
            console.log("ImagePath:"+$scope.foodDetails.foodImagePath);
        },function(response){
            alert("Not able to pull Food Measure List");
        })
    };
    //End Get Particular Food Details
    $scope.doGetFoodDetails();

});

adminApp.controller("FoodDetailsEditController",function($scope,requestHandler,$routeParams,Flash){

    $scope.title="Edit Food";

    //For Tag Input
    $scope.tagTransform = function (newTag) {

        var item = {
            "tagid": null,
            "tagname": newTag
        };

        return item;
    };

    //Get Particular Food Details
    $scope.doGetFoodDetails= function () {
        requestHandler.postRequest("/getFoodDetailByadmin/",{"foodid":$routeParams.id}).then(function(response){
            $scope.foodDetails=response.data.Food_Data;
            $scope.foodDetails.foodImagePath=$scope.foodDetails.foodImagePath.substring($scope.foodDetails.foodImagePath.indexOf("/") + 14, $scope.foodDetails.foodImagePath.length)+"200x200.jpg";

            //For Image
            $('.image-editor').cropit({
                imageState: {
                    src: 'http://192.168.1.236/'+$scope.foodDetails.foodImagePath
                }
            });
            //Set session
            $scope.setSessionValues($scope.foodDetails.sessionid);

        },function(response){
            alert("Not able to pull Food Measure List");
        })
    };
    //End Get

    //SetGet Session Values
    $scope.setSessionValues=function(sessionArray){

        $scope.foodDetails.breakfast=false;
        $scope.foodDetails.brunch=false;
        $scope.foodDetails.lunch=false;
        $scope.foodDetails.eveningsnacks=false;
        $scope.foodDetails.dinner=false;

        $.each(sessionArray, function(index,value) {
            switch(value.sessionid) {
                case 1:
                    $scope.foodDetails.breakfast=true;
                    break;
                case 2:
                    $scope.foodDetails.brunch=true;
                    break;
                case 3:
                    $scope.foodDetails.lunch=true;
                    break;
                case 4:
                    $scope.foodDetails.eveningsnacks=true;
                    break;
                case 5:
                    $scope.foodDetails.dinner=true;
                    break;
                default:
                      break;
            }
        });
    };

    //Get Categories
    $scope.doGetCategories= function () {
        $scope.loaded=true;
        requestHandler.getRequest("admin/getFoodCategoryByStatus","").then(function(response){
            $scope.foodCategoryListAll=response.data.Food_Category;
        },function(response){
            alert("Not able to pull Food Measure List");
        })
    };
    //End Get Food Categories

    //Add New Measure
    $scope.doAddMeasureMinerals=function(id,name){
        $scope.addMeasureSet=$scope.getMeasureSet();
        $scope.addMeasureSet.measureid=id;
        $scope.addMeasureSet.measurename=name;
        var isExist=false;
        var removeIndex=0;
        $.each($scope.foodDetails.measureid, function(index,value){
          if(value.measureid==id){
              isExist=true;
              removeIndex=index;
          }
        });
        if(isExist){
            $scope.foodDetails.measureid.splice(removeIndex,1);
        }
        else{
            $scope.foodDetails.measureid.push($scope.addMeasureSet);
        }
    };
    //End Add Measure


    //Do Update Food
    $scope.doUpdateFoodDetails= function () {

    //Get Update Details
    $scope.foodDetails.sessionid=$scope.getSessionArray();
    $scope.foodDetails.categoryid=$scope.getCategoryArray();
    $scope.foodDetails.tagid=$scope.getTagArray();

    $scope.foodDetails.measuredata=$scope.foodDetails.measureid;


    //Convert Image to base6
    $scope.convertImgToBase64($scope.foodDetails.foodImagePath, function(base64Img) {

        $scope.foodDetails.foodimage=base64Img;

        requestHandler.putRequest("admin/updateFood/", $scope.foodDetails).then(function (response) {
            if (response.data.Response_status == 1) {
                successMessage(Flash,"Food Updated Successfully!");
                $scope.doGetFoodDetails();
            }
        }, function (response) {
            alert("Not able to pull Food Tag");
        });
    });
    };

    // Function to convert image url to base64
    $scope.convertImgToBase64=function(url, callback, outputFormat){
        var img = new Image();
        img.crossOrigin = 'Anonymous';
        img.onload = function(){
            var canvas = document.createElement('CANVAS');
            var ctx = canvas.getContext('2d');
            canvas.height = this.height;
            canvas.width = this.width;
            ctx.drawImage(this,0,0);
            var dataURL = canvas.toDataURL(outputFormat || 'image/jpg');
            callback(dataURL);
            canvas = null;
        };
        img.src = url;
    };



    //Get session array to update
    $scope.getSessionArray=function(){

        //Set Session Array
        var sessionArray=new Array();

        if($scope.foodDetails.breakfast){
            sessionArray.push(1);
        }
        if($scope.foodDetails.brunch){
            sessionArray.push(2);
        }
        if($scope.foodDetails.lunch){
            sessionArray.push(3);
        }
        if($scope.foodDetails.eveningsnacks){
            sessionArray.push(4);
        }
        if($scope.foodDetails.dinner){
            sessionArray.push(5);
        }
        return sessionArray;
    };

    //Get category array to update
    $scope.getCategoryArray=function(){

        var categoryArray=new Array();

        $.each($scope.foodDetails.categoryid, function(index,value) {
            categoryArray.push(parseInt(value.categoryid));
        });

        return categoryArray;

    };


    //Get Tag array to update
    $scope.getTagArray=function(){

        var tagArray=new Array();

        $.each($scope.foodDetails.tagid, function(index,value) {
            if(value.tagid!=null){
                tagArray.push(parseInt(value.tagid));
            }else{
                requestHandler.postRequest("admin/insertFoodTag/",{'tagname':value.tagname}).then(function(response){
                    if(response.data.Response_status==1){
                        tagArray.push(parseInt(response.Food_Tag_Data.tagid));
                    }
                },function(response){
                    alert("Not able to pull Food Tag");
                });
            }
        });

        return tagArray;

    };

    //Get Session
    $scope.doGetSessions= function () {
        requestHandler.getRequest("admin/getFoodSession","").then(function(response){
            $scope.foodSessionList=response.data.Food_Session;
            return $scope.foodSessionList;
        },function(response){
            alert("Not able to pull Food Tag");
        })
    };
    //End Get Food Session

    //Get Tags
    $scope.doGetTags= function () {
        requestHandler.getRequest("admin/getFoodTag","").then(function(response){
            $scope.foodTagList=response.data.Food_Tag_Data;
        },function(response){
            alert("Not able to pull Food Tag");
        })
    };
    //End Get Food Tags

    //Get Measures
    $scope.doGetMeasures= function () {
        $scope.loaded=true;
        requestHandler.getRequest("admin/viewAllfoodMeasure","").then(function(response){
            $scope.foodMeasureListAll=response.data.viewAllfoodMeasure;
            $scope.loaded=false;
            $.each($scope.foodMeasureListAll, function(index,listValue) {
                listValue.checked=false;
                $.each($scope.foodDetails.measureid, function(index,messureValue) {
                    if(messureValue.measureid==listValue.measureid){
                        listValue.checked=true;
                    }
                });
            });

            console.log($scope.foodMeasureListAll);

        },function(response){
            alert("Not able to pull Food Measure List");
        })
    };
    //End Get Food Measures

    //Reset MeasureSet
    $scope.getMeasureSet=function(){
        //Create Measure set object
        var measureSet={"polyunsaturatedfat": null,
            "folicacid": null,
            "vitaminE": null,
            "vitaminC": null,
            "zinc": null,
            "vitaminA": null,
            "protein": null,
            "vitaminK": null,
            "saturatedfat":null,
            "niacin": null,
            "fibre": null,
            "measureid": null,
            "sodium": null,
            "thiamin": null,
            "sugar": null,
            "potassium": null,
            "fat": null,
            "vitaminB12": null,
            "vitaminB6": null,
            "calories": null,
            "value": null,
            "phosphorous": null,
            "calcium": null,
            "riboflavin": null,
            "iron": null,
            "monounsaturatedfat": null,
            "measurename": null,
            "carbo": null
        };
        return measureSet;
    };

    //Initialize Page
    //Get Food Details
    $scope.doGetFoodDetails();

    //Set Measures
    $scope.doGetMeasures();

    //Get Categories
    $scope.doGetCategories();

    //Get Tags
    $scope.doGetTags();
    //End Initialize Page

});

